"Cast to ObjectId failed for value ...." error. Wanting to intercept to create my own error message but getting confused<p>I just graduated from a Full Stack Bootcamp and this is my first post. I am still trying to learn and apply all of this stuff. Working on a portfolio project for a server using NodeJs/MongoDB/Mongoose and am trying to figure out how to intercept the .catch error and generate my own error message. I'm making a PUT request using an object ID for a specific record and everything is working when a valid ID is passed. However, if I test using an invalid ID it goes straight to catch error and bypasses my handling of this type of scenario. Here is the code I'm trying to manipulate:</p>
<pre><code>.put((req, res, next) =&gt; {
    Guitar.findByIdAndUpdate(req.params.guitarId, {$set: req.body}, { new: true })
    .then(guitar =&gt; {
        if (guitar) {
            console.log(guitar);
            res.statusCode = 200;
            res.setHeader('Content-Type', 'application/json');
            res.json(guitar);
        } else {
            res.statusCode = 403;
            res.setHeader('Content-Type', 'text/plain');
            res.end(`${req.params.guitarId} does not match any guitars in database`); 
        }
    })  
    .catch(err =&gt; next(err)); 
}) 
</code></pre>
<p>I assumed that if I tried to pass an invalid ID then if(guitar) would return false, then return my error code. But instead it appears that if an invalid ID is sent then it never gets to that point, instead giving the &quot;Cast to Object Id&quot; failure outside of my if/else code. Am I approaching this incorrectly? Thanks in advance for any insight!!!</p>

