Mongodb: $expr comparing two elements of same array in same document<p>I have some documents with an array <code>v</code> containing exactly 2 objects with two numbers <code>a</code> and <code>b</code> as properties. I want to filter in an aggregation the documents where the two objects in the array have the same <code>b</code> value.</p>
<p>for instance, having this document:</p>
<pre class="lang-json prettyprint-override"><code>[
  {
    &quot;v&quot;: [
      {
        &quot;a&quot;: 1,
        &quot;b&quot;: 1
      },
      {
        &quot;a&quot;: 1,
        &quot;b&quot;: 2
      }
    ]
  }
]
</code></pre>
<p>and this query:</p>
<pre class="lang-js prettyprint-override"><code>db.collection.aggregate([
  {
    &quot;$match&quot;: {
      &quot;$expr&quot;: {
        &quot;$eq&quot;: [
          &quot;$v.0.b&quot;,
          &quot;$v.1.b&quot;
        ]
      }
    }
  }
])
</code></pre>
<p>The document should not pass, because it has two diff values (<code>1</code> and <code>2</code>) for <code>b</code>, but it eventually passes. Why?</p>
<p>Here is the playground: <a href="https://mongoplayground.net/" rel="nofollow noreferrer">https://mongoplayground.net/</a></p>

