Why cant I send specific mongoose.js errors to the client when they enter a username already in use?<p>I am working on implementing custom error handling in a MongoDB MERN application.  Im also using Mongoose and passport-local-mongoose.
When a user registers for a new account, they should get a specific error message in the chrome console saying, username already exists.  I know it is a bad idea to show all the server error messages to the user, but I would like to show a select few.</p>
<p>Links that I have tried:
<a href="https://github.com/saintedlama/passport-local-mongoose" rel="nofollow noreferrer">https://github.com/saintedlama/passport-local-mongoose</a></p>
<p><a href="https://stackoverflow.com/questions/36465196/passport-local-mongoose-authenticate-user-right-after-registration/36498612">Passport-local-mongoose : Authenticate user right after registration</a></p>
<p><a href="https://www.geeksforgeeks.org/nodejs-authentication-using-passportjs-and-passport-local-mongoose/" rel="nofollow noreferrer">https://www.geeksforgeeks.org/nodejs-authentication-using-passportjs-and-passport-local-mongoose/</a></p>
<p>Here is the code:
server/controller/auth.js</p>
<pre><code>const { User } = require('../models');

const register = async function (req, res) {
  try {
    const user = new User({ username: req.body.username });
    await user.setPassword(req.body.password);
    await user.save();
  }
  catch (err) {
    console.log(`error inside save ${err}`);
    res.status(500).send(err);
  }
};

const login = async function (req, res) {
  //code block under construction
  console.log(`login!!!!!`);
};

const logout = function (req, res) {
  req.session.destroy();
  res.end();
};

exports.login = login;
exports.register = register;
exports.logout = logout;
</code></pre>
<p>server/models/User.js</p>
<pre><code>const mongoose = require('mongoose');
const Schema = mongoose.Schema;
const passportLocalMongoose = require('passport-local-mongoose');

const userSchema = new Schema({
  username: { type: String, unique: true },
  password: { type: String}
});

userSchema.plugin(passportLocalMongoose);

const User = mongoose.model('User', userSchema);

module.exports = User;

</code></pre>
<p>server/routes/api/auth/index.js</p>
<pre><code>const router = require('express').Router();
const passport = require('../../../config/passport');
const authController = require('../../../controllers/auth');

router.route('/logout').get(authController.logout);
router.route('/register').post(authController.register);

router.use(passport.authenticate('local', {
  session: true
}));

// Matches with '/api/auth'
router.route('/login').post(authController.login);


module.exports = router;

</code></pre>
<p>server/server.js</p>
<pre><code>const path = require('path');
const express = require('express');
const passport = require('./config/passport');
const mongoose = require('mongoose');
const cors = require('cors');
const session = require('express-session');
const helmet = require('helmet');
const morgan = require('morgan');
const corsOptions = require('./config/cors.js');
const routes = require('./routes');
const { v1: uuidv1 } = require('uuid');

// console.log(uuidv1());

const PORT = process.env.PORT || 3001;
const app = express();

mongoose.connect(process.env.MONGODB_URI || 'mongodb://localhost/puzzlegallery', {
  useNewUrlParser: true,
  useUnifiedTopology: true,
  useCreateIndex: true,
  useFindAndModify: false
});
mongoose.set(&quot;useCreateIndex&quot;, true);

// Define middleware here
app.use(express.urlencoded({ extended: true }));
app.use(express.json());

app.use(helmet({ contentSecurityPolicy: false }));
app.use(session({ secret: 'sassy', resave: false, saveUninitialized: true }));
app.use(passport.initialize());
app.use(passport.session());
app.use(cors(corsOptions));

app.use(morgan('dev'));
app.use(routes);

// for Reactjs ##################
// Serve up static assets (usually on heroku)
if (process.env.NODE_ENV === 'production') {
  app.use(express.static('client/build'));
}
// #################################################

if (process.env.NODE_ENV === 'production') {
  app.get('*', (_, res) =&gt; {
    res.sendFile(path.join(__dirname, '../client/build/index.html'));
  });
}



app.listen(PORT, (err) =&gt; {
  if (err) throw err;
  console.log(
    ` Server is Ready and Listening on http://localhost:${PORT}`
  ); // eslint-disable-line no-console
});

</code></pre>
